import React, { Fragment } from "react";
import { Link } from "react-router-dom";

const CustomerPortal = () => {
  return (
    <Fragment>
      <Link to="/employee-dashboard" className="btn btn-primary">
        Go Back
      </Link>
    </Fragment>
  );
};

export default CustomerPortal;
